import React from 'react';

const OfflineSensors = ({ offlineSensors }) => {
    // Check if sensors is defined before using Object.keys
    const offlineSensorIds = sensors
        ? Object.keys(sensors).filter(sensorId => (
            sensors[sensorId]?.historical_data?.value < 0 || sensors[sensorId]?.historical_data?.value > 4
            ))
        : [];

    return (
        <div>
        <h2>Offline Sensors</h2>
        <ul>
            {Object.keys(offlineSensors).map(sensorId => {
                const sensor = offlineSensors[sensorId]
                return (sensor &&
                    <React.Fragment key={sensorId}>
                    <li key={sensor}>
                        {sensor}
                    </li>
                </React.Fragment>
                );
            })}
        </ul>
        </div>
    );
};

export default OfflineSensors;
